@Component({
  selector: 'app-medicina-intro',
  templateUrl: './intro.component.html',
  styleUrls: ['./intro.component.css']
})
export class IntroComponent {

}
<div class="b-example-divider"></div>

<div class="p-4 p-md-5 mb-4 rounded text-body-emphasis bg-body-secondary">
  <div class="col-lg-6 px-0">
    <h1 class="display-4 fst-italic">ANATOMÍA HUMANA 3D</h1>
    <p class="lead my-3">Aumenta tu conocimiento sobre la antomía humana, gracias diversos recursos de estudio como
      muestras 3D, videos de anatomia, radiografías y dibujos. Dispones de un test rápido para poner a prueba tus
      conocimientos.</p>
